n 9Now: https://9now.app.link/uNP4qBkmN6 Subscribe here: http://9Soci.al/chmP50wA97J \nIlha de Queimada Grande, better known as ‘Snake Island,’ is a tiny pocket of land off the coast of Brazil. Home to 4000 Golden Lancehead Vipers, one of the deadliest snakes in the world, the island is considered the most dangerous acreage on the planet. Humans are banned from visiting unless given special clearance. But on 60 Minutes, reporter Tara Brown journeys to the island with Australian molecular biologist and self-confessed snake geek, Bryan Fry as part of a research project studying the potential medical benefits of the snakes’ venom.\n\nWATCH more of 60 Minutes Australia: https://www.60minutes.com.au \nLIKE 60 Minutes Australia on Facebook: https://www.facebook.com/60Minutes9 \nFOLLOW 60 Minutes Australia on Twitter: https://twitter.com/60Mins \nFOLLOW 60 Minutes Australia on Instagram: https://www.instagram.com/60minutes9\n\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\n\n#60MinutesAustralia","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/oa1Tu6BRFxU/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDky5VpH0snLSUMJxxqUI0XzzBU8Q","width":168,"height":94},{"url":"https://i.ytimg.com/vi/oa1Tu6BRFxU/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBo3oPOoVHFqPri6Rf8PLxFqjK31Q","width":196,"height":110},{"url":"https://i.ytimg.com/vi/oa1Tu6BRFxU/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAOPsNaloMHHN-t4c31WOTgySrvDA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/oa1Tu6BRFxU/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAA
